import useFetchData from '../hooks/fetchData';
import {useNavigate} from 'react-router-dom';


const ProductPage = () => {

    const { data, error, loading } = useFetchData('products');

    const selectProduct = (e) =>{
        console.log(e.target.id);
    }

    const navigate = useNavigate();

  const changeProductPage = () => {
    navigate('product');
  };

    if(error){
        return(
            <div>
                there was an error
            </div>
        );
    }

    if(loading){
        return(
            <div>
                THE PAGE IS LOADING
            </div>
        )
    }

    // this is the display for the items, its the list
    return (
        <>
            {data?.map((product) => {
                return (
                    <button key={product.id} id={product.id} onClick={(e)=>{selectProduct(e)}}>
                        <p id={product.id}>{product.title}</p>

                    </button>
                );
            })}
        </>
    );
}


export default ProductPage;
